    const hamberug = () => {


        nav('/')

    }

    return (<div>





        <div style={{ marginTop: "75px" }}>

        <div>
            <button  
             onClick={hamberug}
              class="close" aria-label="Close">
                  X
            </button>
        </div>

            <h2 class="h2">HOME</h2>
            <br></br>
            <h2 class="h2">ABOUT</h2>
            <br></br>
            <h2 class="h2">RESUME</h2>
            <br></br>
            <h2 class="h2">BEHANCE</h2>
            <br></br>
            <h2 class="h2">PHOTOGRAPHY</h2>
            <br></br>
            <h2 class="h2">FOR FUN</h2>
        </div>






    </div>)
}

